import React from 'react';
import './App.css';
import HeaderMenu from './components/HeaderMenu'
import Intro from './components/Intro'

function App() {
  return (
    <div className="App">
      <HeaderMenu/>
      <Switch>
               <Route path="/all_article">
                    <Articles/>
               </Route>
               <Route>
                   <Shops/>
               </Route>
      </Switch> 
    </div>
  );
}

export default App;
